import React from 'react';
import styled from "styled-components";

const newblock = styled.div` 
  backgroundColor: "whitesmoke";
    borderRadius: "50px";
    display: "block";
    width: "5000px";
    height: "600px";
    textAlign: "center";
    marginLeft: "185px";
    marginTop: "20px";
    alignContent: "center"
`;

export const NewReport = (props) => (
    <newblock> Generate a New Report </newblock>
)
